import { gql } from 'apollo-boost';

export const CURRENT_USER = gql`
    query CurrentUSer {
        currentUser {
            id
            name
            profilePicUrl
        }
    }
`;

export const LOGOUT= gql`
    mutation LogOut {
        logout {
            resp
        }
    }
`
